import React from "react";

const ModalAgregarTrabajo = () => {
    return (
        <div 
            className="modal fade"
            id="modalGuardarTrabajo"
            tabIndex="-1"
            aria-labelledby="modalGuardarTrabajoLabel"
            aria-hidden="true"
        >

            <div className="modal-dialog">
                <div className="modal-content">
                    <div className="modal-body">
                        <div className="mb-3 text-center fs-3">
                            Trabajo creado con exito!
                        </div>
                        <div className="mb-3 " style={{
                                height: "200px",
                                overflow: "hidden",
                                borderRadius: "20px"
                            }} >
                            <img src="/images/succes.gif" alt=""  style={{
                                height: "200px",

                            }}/>
                        </div>
                    </div>
                </div>
            </div>

        </div>
    )
}

export default ModalAgregarTrabajo;
